import React from 'react';
import Container from '../components/container';
import { Button, Input, Form } from '../components/uiComponent';
import { useInput } from './login';

const SignUp = () => {
    const [userName, setUserName] = useInput('')
    const [userEmail, setUserEmail] = useInput('')
    const [userPassword, setUserPassword] = useInput('')
    const [userPasswordCheck, setUserPasswordCheck] = useInput('')
  return (
    <Container>
      <Form>
        <label>회원가입</label>
        <Input type="text" placeholder="이름" value={userName} />
        <Input type="email" placeholder="이메일" value={userEmail} />
        <Input type="password" placeholder="패스워드" value={userPassword} />
        <Input type="password" placeholder="패스워드 확인" value={userPasswordCheck} />
        <Button>회원가입</Button>
      </Form>
    </Container>
  );
};

export default SignUp;
